import React, { Component } from 'react';
import ScrollAnimation from 'react-animate-on-scroll';
import mypic from './assets/mypic.jpg';

class About extends Component{
    render() {
  return (
  	<div id="about" className="about">
	  	<img className="mypic" src={mypic} alt="headshot" />
	  	<h1>Douglas Coke</h1>
	  	<h2>Web Developer</h2>
  	<ul className="socialbtns">
		<li><a href="https://github.com/Dcoke1" target="_blank" rel="noopener noreferrer" className="fa fa-2x fa-github"></a></li>
		<li><a href="https://www.linkedin.com/in/douglascoke/" target="_blank" rel="noopener noreferrer" className="fa fa-2x fa-linkedin"></a></li>
		<li><a href="https://www.freecodecamp.org/dcoke17" target="_blank" rel="noopener noreferrer" className="fa fa-2x fa-free-code-camp"></a></li>
	</ul>

	<div className="skills">

	<ScrollAnimation animateIn="slideInUp">

	<ul className="skillsIcons">
	<div className="subSkills"><i class="fas fa-laptop-code"></i><span className="skillsSpan">UI/UX</span><p className="skillsP">UX design is all about understanding the user’s needs and putting them first. In order to do this you must anticpate your user’s desires.</p></div>
	<div className="subSkills"><i class="far fa-address-card"></i><span className="skillsSpan">Responsive Design</span><p className="skillsP"> </p></div>
	<div className="subSkills"><i class="far fa-handshake"></i><span className="skillsSpan">Team Player</span><p className="skillsP"> </p></div>
	<div className="subSkills"><i class="fas fa-running"></i><span className="skillsSpan">Versatile</span><p className="skillsP"> </p></div>
	</ul>

	</ScrollAnimation>
	</div>

  	</div>

    );
  }
}

export default About;
